import { Select } from "antd";
import { useNavigate } from "react-router-dom";


function AdminNavBar(){
    const {Option} = Select;
    const navigate = useNavigate();
    const [selectedValue, setSelectedValue] = useState(null)
    const handleChange = (value)=>{
        setSelectedValue(value);
        navigate(`${value}`);
    }

    return(
        <div>
            <Select defaultValue='userMenegment' onChange={handleChange}>
                <Option value='userBlocking'>Blocking</Option>
                <Option value='orderStatusChange'>Change order status</Option>
            </Select>
            <Select defaultValue='getStatistics' onChange={handleChange }>
                <Option value='usersData'>Get users data</Option>
                
            </Select>
            <Select defaultValue='Directory management' onChange={handleChange}>
                <Option value = 'standart-pizza-list'></Option>
            </Select>
        </div>
    )
}
export default AdminNavBar;
